import React from 'react';
import { StyleSheet, Text, View, SafeAreaView } from 'react-native';

const currencyPerRupee={
  DOLLER:0.014,
  EURO:0.012,
  POUND:0.011,
  RUBEL:0.93,
  AUSDOLLER:0.2,
  CANDOLLER:0.019,
  YEN:1.54,
  DINAR:0.0043,
  BITCOIN:0.0000041,
}
export default class App extends React.Component { 
constructor(props){
  super(props);
  this.state={
    inputValue:"",
    resultValue:"0.0",
  }
}

render(){
   return (
     <SafeAreaView style={styles.container}>
        <View style={styles.screenview}>
          <View style={styles.resultcontainer}>
              <Text style={styles.resultvalue} >
                  {this.state.resultValue}
              </Text> 
          </View>
        </View>
      </SafeAreaView>
    );
  }
}

const styles = StyleSheet.create({
   container: {
     flex: 1,
     marginTop:20,
     backgroundColor: '#26ae60',
     alignItems: 'center',
     justifyContent: 'center',
   },
   resultcontainer:{
      height:30,
      marginTop:20,
      justifyContent:"center",
      borderColor:"#c1c1c1",
      backgroundColor:"#0A79DE",
      alignItems:"center",
      borderWidth:"2",
   },
   resultvalue:{
      fontSize:30,
      fontWeight:"bold",
      color:"#FFF"
   },
  screenview:{
    flex:1,
  }
});
